import React from 'react';
import api from '../services/OpenAI';

class ImageGeneratorForm extends React.Component{
    constructor(props){
        super(props);
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
        this.state = {
            value: '',
            url: '',
            api: api,
        };
    }

    handleChange(event){
        this.setState({value: event.target.value});
    }

    handleSubmit(event){
        console.log(this.state.value);
        event.preventDefault();
    }

    render(){
        return (
            <>
            <div className="image-container-form">
            <form name="image-form" id="image-form" onSubmit={this.handleSubmit}>
                <label>
                Image the descripitons:
                </label>
                <input  type="text" 
                        name="image-description" 
                        id="image-description"
                        value={this.state.value} onChange={this.handleChange} />
                <label className='submit-buttom'>
                <input type="submit" value="Submit" />
                </label>
            </form>
            </div>
            </>
        )
    }

    consultImageGenerator(){
        if (this.state.value === ''){
            return;
        }
        this.state.api.post("cv-image-generator/descriptions/"+this.state.value).then(
            res =>{
                this.setState({ specie: res.data.specie });
                this.setState({ petNames: res.data.names});
            });
        return(
            <div className="result-image-generated">
                <img src={this.state.url} alt={this.state.value} />
            </div>
        )
    }

}

export default ImageGeneratorForm;
